function fetchTiming(districtName, targetDate) {
    try {
        
        const dataObject = ramadanData[0]; 
        
      
        const district = districtName.toLowerCase().trim();

        if (dataObject[district]) {
          
            const dayInfo = dataObject[district].find(item => item.date === targetDate);

            if (dayInfo) {
               
                const sehriEl = document.getElementById("sehri");
                const fajrEl = document.getElementById("fajr");
                const ifterEl = document.getElementById("iftar");

                
                if (sehriEl) sehriEl.textContent = `Sehri Ends: ${dayInfo.sehri_end}`;
                if (fajrEl) fajrEl.textContent = `Fajr: ${dayInfo.fajr_azan}`;
                if (ifterEl) ifterEl.textContent = `Iftar Starts: ${dayInfo.iftar_time}`;
                
                console.log(`Success: Found data for ${district} on ${targetDate}`);
                return dayInfo;
            } else {
                console.error(`Date ${targetDate} not found in ${district}.`);
            }
        } else {
            console.error(`District "${district}" not found in the data.`);
        }
    } catch (error) {
        console.error("Error processing ramadanData:", error);
    }
}



